import { useState } from "react"

const Admin = ()=>{
    const [Code,Setcode] = useState("");
    const handleCode =(event)=>{
        Setcode(event.target.value)
    }
    
    return(
        <>
        {Code}
        <form>
            <div>
                <label>Code</label>
                <input type="text" name="code" onChange={handleCode} value={Code}/>
            </div>
        </form>
        </>
    )
}
export default Admin;
